import mine from './mine.png';
import dayPlanner from './DayPlanner.png';
import employeeTeamBuillder from './EmployeeTeamBuilder.png';
import noteTaker from './NoteTaker.png';
import passwordGenerator from './PasswordGenerator.png';
import readmeGenerator from './ReadmeGenerator.png';
import trailr from './trailr.png';
import tripExpensePlanner from './TripExpensePlanner.png';
import vacationPlanner from './VacationPlanner.gif';
import background from './background.jpg';
import github from './github.png';
import linkedin from './linkedin.png';
import fitnesstracker from './Fitness-Tracker.gif';
import budgetTracker from './Budget-tracker.gif';

const images = {
    mine,
    dayPlanner,
    employeeTeamBuillder,
    noteTaker,
    passwordGenerator,
    readmeGenerator,
    trailr,
    tripExpensePlanner,
    vacationPlanner,
    background,
    github,
    linkedin,
    fitnesstracker,
    budgetTracker,
};

export default images;
